import React from "react";
import { TextField } from "@material-ui/core";



const CustomTextField :  React.FC<{}> = () => {

    return (
        <div >
                 <TextField id="outlined-basic" label="Outlined" variant="outlined" style={{

          width: "450px%",
          borderColor: "blue",
          padding:'5px',
          marginLeft:'3%',
          marginBottom: "3%",
          borderRadius: "30px",

        }}/>
        </div>
    );


}

export default CustomTextField;
